package First;

public class IfElseDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 10, y = 20;
		if (x > y) {
			System.out.println("x is greater");
		} else if (y > x) {
			System.out.println("y is greater");
		} else {
			System.out.println("equal");
		}
	}

}
